import React from "react";
import styles from "./index.module.css"

const Homepage = () => {
  return (
    <div className={styles.homepage}>
      <div className={styles['homepage__left-content']}>
        <div className={styles['homepage__left-content__inside']}>
          <p style={{fontWeight: 600, fontSize: 48, color: "white"}}>Lorem ipsum dolor sit amet 
            <br />
            <span style={{color: "#3E334E"}}>consectetur</span>
          </p>
          <p style={{fontWeight: 400, fontSize: 18, color: "#3E334E"}}>Lorem ipsum dolor sit amet consectetur adipisicing elit. Minima consequuntur facilis ex. Adipisci sequi nesciunt facilis quibusdam doloribus rerum iure minus maiores, architecto incidunt! Repellat impedit ea amet deleniti dolorem.</p>
        </div>
      </div>
    </div>
  );
}

export default Homepage;
